import React from 'react';
import '../styles/pages/Dashboard.css'; // Link the CSS file for styling

const Dashboard = () => {
  const stats = [
    { title: 'Total Jobs', value: 42, icon: 'üìã' },
    { title: 'Active Jobs', value: 18, icon: 'üõ†Ô∏è' },
    { title: 'Completed Jobs', value: 24, icon: '‚úÖ' },
    { title: 'Users Online', value: 15, icon: 'üë•' },
  ];

  return (
    <div className="dashboard-page">
      <header className="dashboard-header">
        <h1>Welcome to Your Dashboard</h1>
        <p>Track your performance, manage jobs, and monitor progress.</p>
      </header>

      <main className="dashboard-content">
        <section className="dashboard-stats">
          {stats.map((stat, index) => (
            <div key={index} className="stat-card">
              <div className="stat-icon">{stat.icon}</div>
              <h3>{stat.title}</h3>
              <p>{stat.value}</p>
            </div>
          ))}
        </section>

        <section className="dashboard-recent">
          <h2>Recent Activity</h2>
          <ul className="activity-list">
            <li>Job #123 has been completed.</li>
            <li>New job posted: "Build a Website".</li>
            <li>User John Doe started working on Job #122.</li>
            <li>Payment for Job #121 has been processed.</li>
          </ul>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;
